import React from "react";
import Navbar from "./Navbar.module.css";
import { Link } from "react-router-dom";
import { data } from "./data";
import cx from 'classnames';

const NavBar = () => {
  return (
    <div id="main-menu">
      {" "}
      <menu className={Navbar.main}>
        <label id="hamburger-menu">
          <input type="checkbox" />
          <span className={Navbar.menu}>
            {" "}
            <span className={Navbar.hamburger}></span>{" "}
          </span>
          <ul className={Navbar.ul}>
            {data.map((ele, i) => {
              return (
                <div key={i}>
                  {" "}
                  <br />
                  <li>
                    {" "}
                    <Link id={Navbar.li} to={ele.path}>
                      {ele.name}
                    </Link>
                  </li>{" "}
                  <br />
                </div>
              );
            })}{" "}
            <br />
          </ul>{" "}
          {/* </div> */}
          {/* <li>
              {" "}
              <Link className="li" to="/">
                Order
              </Link>{" "}
            </li>{" "}
            <br />
            <br />
            <li>
              {" "}
              <Link className="li" to="/">
                Leaderboards
              </Link>{" "}
            </li>{" "}
            <br />
            <br />
            <li>
              {" "}
              <Link className="li" to="/">
                Marketplace
              </Link>{" "}
            </li>{" "}
            <br />
            <br />
            <li>
              {" "}
              <Link className="li" to="/faqs">
                FAQs
              </Link>{" "}
            </li>{" "} */}
          {/* <br /> <br /> */}
        </label>
      </menu>
      <div className={Navbar.div}>
        <Link to="/home">
          <img
            className={Navbar.logo}
            src="./images/Twenteefore - Logo 2.png"
            alt="logo"
          />
        </Link>
        <nav className={Navbar.navbar}>
          {data.map((element, index) => {
            return (
              <div key={index}>
                <Link className={(element.className , Navbar.className)} to={element.path}>
                  {element.name}
                </Link>
              </div>
            );
          })}{" "}
        </nav>

        {/* <Link className="homeLink" to="/">
          Home
        </Link>
        <Link className="orderLink" to="/">
          Order
        </Link>
        <Link className="leaderboardsLink" to="/">
          Leaderboards
        </Link>{" "}
        <Link className="marketplaceLink" to="/">
          Marketplace
        </Link>{" "}
        <Link className="faqsLink" to="/faqs">
          FAQs
        </Link> */}
      </div>
      <Link className={Navbar.loginLink} to="/login">
        <button id={Navbar.loginLink}>Log In</button>
      </Link>
    </div>
  );
};
export default NavBar;
